import React from "react";
import {Navbar,Nav} from 'react-bootstrap';
import { Link } from "react-router-dom";

function Navb() {
    return (
      <div>
       <Navbar collapseOnSelect expand="lg" className="nav" variant="dark">
  <Navbar.Brand href="#home"><img className="logo" src="./images/logo.png" alt =""/></Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Acceuil</Nav.Link>
    </Nav>
    <Nav>
      <Nav.Link href="#deets"><Link to="./favoris">Home</Link></Nav.Link>
      <Nav.Link href="#deets"><Link to="./favoris">Favori</Link></Nav.Link>
      <Link to="/">Home</Link>
      <Link to="./favoris">Favori</Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>

      </div>
    );
  }

  export default Navb;
